    Route,
    Link,
    useParams

  } from 'react-router-dom' ;


class World_info extends React.Component{

    constructor(props){

        super(props); 

        this.state = {
            name : "India"
        }

        console.log("This is country constructor") ;

    }

    componentDidMount(){

        // do nothing as of now 

    }

